import{_ as e,o,c as t,Q as i}from"./chunks/framework.4719a631.js";const g=JSON.parse('{"title":"Changelog","description":"","frontmatter":{},"headers":[],"relativePath":"docs/changelog.md","filePath":"docs/changelog.md"}'),r={name:"docs/changelog.md"},a=i('<h1 id="changelog" tabindex="-1">Changelog <a class="header-anchor" href="#changelog" aria-label="Permalink to &quot;Changelog&quot;">​</a></h1><p>Here you can see that changes were made at each release of the main framework and the live plugin:</p><h2 id="_0-43-0-5-october-2023" tabindex="-1">0.43.0 (5 October 2023) <a class="header-anchor" href="#_0-43-0-5-october-2023" aria-label="Permalink to &quot;0.43.0 (5 October 2023)&quot;">​</a></h2><ul><li>[NEW FEATURE] Added support for Python <code>3.10</code> and Python <code>3.11</code>. Both the main framework and livetrading plugin.</li><li>[IMPROVEMENT] The style of the equity curve chart has been improved. Special thanks to a pull request submitted by <a href="https://github.com/Movy" target="_blank" rel="noreferrer">Movy</a>. Check out the pull request <a href="https://github.com/jesse-ai/jesse/pull/391" target="_blank" rel="noreferrer">here</a>.</li><li>[FIX] Fixed the <code>Order size must adhere to quantity step of 10</code> error when submitting orders on DYDX for small-sized symbols like <code>TRX-USD</code>.</li><li>[FIX] Resolved the <code>Cannot cancel order with id: xxx because it is already canceled</code> error on DYDX.</li><li>[FIX] Improved the detection of market orders for lower prices, reducing the chance of trading errors.</li></ul><h2 id="_0-42-0-7-may-2023" tabindex="-1">0.42.0 (7 May 2023) <a class="header-anchor" href="#_0-42-0-7-may-2023" aria-label="Permalink to &quot;0.42.0 (7 May 2023)&quot;">​</a></h2><ul><li>[NEW FEATURE] Added support for our first DEX: <a href="https://jesse.trade/dydx" target="_blank" rel="noreferrer">DYDX</a>.</li><li>[NEW FEATURE] Added new properties to the Strategy API: <a href="https://docs.jesse.trade/docs/strategies/api.html#is-backtesting" target="_blank" rel="noreferrer">is_backtesting</a>, <a href="https://docs.jesse.trade/docs/strategies/api.html#is-backtesting" target="_blank" rel="noreferrer">is_livetrading</a>, <a href="https://docs.jesse.trade/docs/strategies/api.html#is-papertrading" target="_blank" rel="noreferrer">is_papertrading</a>, <a href="https://docs.jesse.trade/docs/strategies/api.html#is-live" target="_blank" rel="noreferrer">is_live</a></li><li>[IMPROVEMENT] Jesse will now retry a failed STOP order with a MARKET order with the same size if the reason for it is its trigger price being in such a way that would have caused instant execution. This is an experimental feature and currently works only on <code>Bybit</code>.</li><li>[IMPROVEMENT] Improves how order type is detected by Jesse to prevent unwanted order order types.</li><li>[IMPROVEMENT] Improved detection of order types to prevent unwanted order types in the live mode.</li><li>[FIX] Fixes the <code>TypeError: Cannot parse single argument of type &lt;class &#39;numpy.ndarray&#39;&gt;.</code> error when local candle generation is enabled.</li><li>[FIX] Fixes the <code>KeyError: &#39;data&#39;</code> error in some cases of live sessions on <code>Bybit</code>.</li><li>[FIX] Fixes the <code>KeyError: &#39;cum_exec_qty&#39;</code> error in some cases of live sessions on <code>Bybit</code>.</li></ul><h2 id="_0-41-0-3-november-2022" tabindex="-1">0.41.0 (3 November 2022) <a class="header-anchor" href="#_0-41-0-3-november-2022" aria-label="Permalink to &quot;0.41.0 (3 November 2022)&quot;">​</a></h2><ul><li>[BREAKING] On <code>FTX Perpetual Futures</code> exchange, symbols ending in <code>PERP</code> format are not supported anymore. Previously Jesse replaced the ending <code>PERP</code> with <code>USD</code> in the database but that was causing confusions.</li><li>[NEW FEATURE] Added support for <code>Bitget USDT Futures</code> driver.</li><li>[NEW FEATURE] Added a &quot;free&quot; plan allowing to trade live on <a href="https://jesse.trade/bitget" target="_blank" rel="noreferrer">Bitget.com</a>.</li><li>[IMPROVEMENT] Added proper handling for the rare <code>listenKeyExpired</code> event that happened on <code>BinancePerpetualFutures</code> driver leading to the WebSocket connection for user account data not working anymore without throwing any errors.</li><li>[IMPROVEMENT] Improves the ping-pong mechanism of the WebSocket connection on <strong>Bybit</strong> drivers leading to less disconnections (and reconnections).</li><li>[IMPROVEMENT] Improved handling of orders when deciding on the order types in a way to work better on sudden price changes.</li><li>[IMPROVEMENT] Improved handling of exit orders to prevent <code>Cannot submit a reduce_position order when there is no open position</code> error occuring when a position is suddenly closed while Jesse&#39;s trying to execute a batch of (exit) orders.</li><li>[FIX] Fixed the <code>TypeError: &#39;NoneType&#39; object is not subscriptable</code> error in <strong>Bybit</strong> drivers.</li><li>[FIX] Fixed the <code>TypeError: unsupported operand type(s) for -: &#39;NoneType&#39; and &#39;float&#39;</code> error in <strong>Bybit</strong> drivers.</li><li>[FIX] Fixed the<code>TypeError: Cannot parse single argument of type &lt;class &#39;numpy.ndarray&#39;&gt;</code> raised in live sessions with &quot;local candle generation&quot; enabled.</li><li>[FIX] Fixed the issue where candles were not showing up in the live chart when &quot;local candle generation&quot; was enabled.</li><li>[FIX] Added handling of the <code>WebSocketConnectionClosedException</code> error in <code>Bybit USDT Perpetual</code> so that the running session won&#39;t be terminated.</li></ul><h2 id="_0-40-0-3-october-2022" tabindex="-1">0.40.0 (3 October 2022) <a class="header-anchor" href="#_0-40-0-3-october-2022" aria-label="Permalink to &quot;0.40.0 (3 October 2022)&quot;">​</a></h2><ul><li>[BREAKING CHANGE] Removed the experimental plugin system used for defining custom exchange drivers for backtesting.</li><li>[BREAKING CHANGE] Implemented a new method called <a href="https://docs.jesse.trade/docs/strategies/entering-and-exiting.html#before-terminate" target="_blank" rel="noreferrer">before_terminate</a> which does exactly what the <code>terminate()</code> used to do. And slightly changed the <code>terminate()</code> method. To see their differences, check the updated documentation for <a href="https://docs.jesse.trade/docs/strategies/entering-and-exiting.html#before-terminate" target="_blank" rel="noreferrer">before_terminate</a> and <a href="https://docs.jesse.trade/docs/strategies/entering-and-exiting.html#terminate" target="_blank" rel="noreferrer">terminate</a>.</li><li>[NEW FEAWTURE] Implemented new event handler methods used for communicating among multiple strategies/routes: <code>on_route_open_position</code>, <code>on_route_close_position</code>, <code>on_route_increased_position</code>, <code>on_route_reduced_position</code>, <code>on_route_canceled</code>.</li><li>[IMPROVEMENT] Position entry price now displays all the digits after the decimal point.</li><li>[IMPROVEMENT] Added a warning if the open position is not in the list of trading symbols.</li><li>[IMPROVEMENT] Improved some error messages to include links to the related help center page.</li><li>[IMPROVEMENT] Improved authentication renewing of the WebSocket connection on Binance drivers.</li><li>[IMPROVEMENT] Changed &quot;bybit.com&quot; endpoints to &quot;bytick.com&quot; in hopes of a better network connectivity as it is mentioned on Bybit&#39;s docs.</li><li>[IMPROVEMENT] The &quot;Reccuring position reports&quot; feature of live sessions will now send reports even if the position is closed. This is to let you know that the bot is running (and not unexpectedly crashed for any reason).</li><li>[FIX] Fixed <code>TypeError: Cannot parse single argument of type &lt;class &#39;numpy.ndarray&#39;&gt;.</code> for optimize mode</li><li>[FIX] Fixed <code>TypeError: Cannot parse single argument of type &lt;class &#39;numpy.ndarray&#39;&gt;.</code> when using extra candles in live mode while &quot;local candle generation&quot; is enabled.</li><li>[FIX] Fixed the issue of exchanges not appearing in the live settings.</li><li>[FIX] Fixed the &quot;Ratio Avg Win / Avg Loss&quot; metric being always zero in backtest metrics.</li><li>[FIX] Fixed the <code>store_candles()</code> function from the <code>research</code> module. Also added validation for its inputs to prevent future issues.</li><li>[FIX] Fixed the <code>TypeError: unsupported operand type(s) for *: &#39;NoneType&#39; and &#39;float&#39;</code> error for a case after starting a session with the &quot;persistency&quot; feature enabled.</li></ul><h2 id="_0-39-0-24-august-2022" tabindex="-1">0.39.0 (24 August 2022) <a class="header-anchor" href="#_0-39-0-24-august-2022" aria-label="Permalink to &quot;0.39.0 (24 August 2022)&quot;">​</a></h2><ul><li>[NEW FEATURE] Added The option to NOT generate candles (for timeframes bigger than 1m) locally and instead fetching them from the exchange.</li><li>[NEW FEATURE] Added a new config for choosing between fetching candles for all timeframes from the exchange or generating them locally.</li><li>[BREAKING] Added timeframe parameter to fetch() method of the import-candle drivers. In case you have developed your own drivers, you should update it accordingly.</li><li>[IMPROVEMENT] Improved the migration handling. This allows for easier updates in the future and also faster startup time for Jesse as duplicate migrations will not be performed.</li><li>[IMPROVEMENT] By default, when you open the settings page, it will now open the relative section to the page you&#39;re in. For example, if you&#39;re in the live trading section and click on the settings button, it&#39;ll open the live trading section.</li><li>[FIX] Fixed the <code>KeyError: &#39;stepSize&#39;</code> error on the <code>Binance Spot</code> driver caused by an unexpected update of Binance&#39;s API.</li><li>[FIX] Fixed a bug when calling <code>import_candles_mode.run()</code> from the <code>research</code> module. Many thanks to <a href="https://github.com/getorca" target="_blank" rel="noreferrer">getorca</a> for submitting the <a href="https://github.com/jesse-ai/jesse/pull/359" target="_blank" rel="noreferrer">PR</a>.</li></ul><h2 id="_0-38-3-6-august-2022" tabindex="-1">0.38.3 (6 August 2022) <a class="header-anchor" href="#_0-38-3-6-august-2022" aria-label="Permalink to &quot;0.38.3 (6 August 2022)&quot;">​</a></h2><ul><li>[NEW FEATURE] Added support for live trading on <code>Binance US Spot</code>.</li><li>[IMPROVEMENT] Improved handling of stop orders on <code>Binance Spot</code> to ensure order fills in markets with low liquidity.</li><li>[FIX] Fixed the <code>{&#39;code&#39;: -2011, &#39;msg&#39;: &#39;Unknown order sent.&#39;}</code> error on <code>Binance Spot</code> driver.</li><li>[FIX] Fixed an issue where you could not close the position using <code>update_position()</code> and immediately open a new one in live and paper modes.</li></ul><h2 id="_0-38-0-10-july-2022" tabindex="-1">0.38.0 (10 July 2022) <a class="header-anchor" href="#_0-38-0-10-july-2022" aria-label="Permalink to &quot;0.38.0 (10 July 2022)&quot;">​</a></h2><ul><li>[NEW FEATURE] Added support for live spot trading on <code>Binance.com</code>, <code>FTX.com</code>, and <code>FTX.us</code></li><li>[IMPROVEMENT] Improved handling of queued orders when trading multiple routes in the live mode.</li><li>[IMPROVEMENT] Loaded DNA values are now logged at the beginning of the live mode if the debugging mode is enabled.</li><li>[IMPROVEMENT] Added validation for timeframe of passed candles to <code>research.backtest()</code> to prevent confusions.</li><li>[IMPROVEMENT] Queued orders&#39; price points are now displayed on the real-time chart in the live mode.</li><li>[IMPROVEMENT] Increased the font size of logs in live trading.</li><li>[IMPROVEMENT] Improved behavior of the download links for backtest results so you won&#39;t face the exit popup question when you click on them.</li><li>[IMPROVEMENT] Added proper handling of <code>{&#39;code&#39;: -2011, &#39;msg&#39;: &#39;Unknown order sent.&#39;}</code> errors on <code>Binance Perpetual Futures</code> which were occurring after a &quot;reduced position&quot; event.</li><li>[FIX] Fixes a bug where the <code>dna()</code> was not being loaded in the live mode.</li><li>[FIX] Fixed the issue with the detection of liquidation orders on BinanceFutures</li><li>[FIX] Fixed the <code>ImportError: numpy.core.multiarray failed to import</code> error related to numpy in new installations on Ubuntu.</li><li>[FIX] Fixed an issue causing <code>KeyError: &#39;futures_leverage&#39;</code> error in new installations.</li><li>[FIX] Fixed an issue where there are duplicate exchange names in the routes exchange list.</li></ul><h2 id="_0-37-0-10-june-2022" tabindex="-1">0.37.0 (10 June 2022) <a class="header-anchor" href="#_0-37-0-10-june-2022" aria-label="Permalink to &quot;0.37.0 (10 June 2022)&quot;">​</a></h2><ul><li>[BREAKING CHANGE] The database tables must be deleted for:</li></ul><ol><li>new settings which support spot trading</li><li>for new indexing of candles table which now loads X times faster</li></ol><ul><li>[BREAKING CHANGE] Removed the driver for &quot;Binance Inverse Futures&quot; (known as coin-margined futures on Binance) from the list of supported exchanges for import candles.</li><li>[BREAKING CHANGE] Updated exchange names to be more similar to what they are on the exchange websites to avoid confusion.</li><li>[BREAKING CHANGE] Updated the required config object that is passed to the <code>research.backtest()</code> function based on the mentioned changes in this release. Removed the <code>settlement_currency</code> and added &#39;type&#39;. Read the example on the <a href="https://docs.jesse.trade/docs/research/backtest.html#usage-example" target="_blank" rel="noreferrer">documentation page</a> for more details.</li><li>[BREAKING CHANGE] The alias <code>self.capital</code> has been removed to prevent confusion. Please use <code>self.balance</code> instead. <strong>Make sure to update your strategies accordingly</strong>.</li><li>[BREAKING CHANGE] The <code>should_cancel()</code> method has been renamed to <code>should_cancel_entry()</code> which is more convenient since it is only used for canceling entry orders. <strong>Make sure to update your strategies accordingly</strong>.</li><li>[NEW FEATURE] Added <code>previous_qty</code> property to the Position class.</li><li>[NEW FEATURE] Added the <a href="https://docs.jesse.trade/docs/strategies/api.html#exchange-type" target="_blank" rel="noreferrer">self.exchange_type</a>, <a href="https://docs.jesse.trade/docs/strategies/api.html#daily-balances" target="_blank" rel="noreferrer">self.daily_balances</a> properties to the Strategy class.</li><li>[NEW FEATURE] Added <a href="https://docs.jesse.trade/docs/strategies/api.html#is-spot-trading" target="_blank" rel="noreferrer">self.is_spot_trading</a> and <a href="https://docs.jesse.trade/docs/strategies/api.html#is-futures-trading" target="_blank" rel="noreferrer">self.is_futures_trading</a> properties to the Strategy class.</li><li>[IMPROVEMENT] The settlement currency is no longer fixed to <code>USDT</code> or <code>USD</code>. Instead, it is now the quote currency of the symbol you&#39;re trading. So it could be <code>USD</code>, <code>USDT</code>, <code>BUSD</code>, <code>BTC</code> (for spot markets), etc.</li><li>[IMPROVEMENT] The existence of <code>plugins.py</code> is now optional. It has been removed from new projects for the sake of simplicity. If you need to add a driver, you can do so by creating the file manually.</li><li>[IMPROVEMENT] The &quot;Exchange type&quot;, &quot;Leverage&quot;, and &quot;Leverage Mode&quot; are now displayed on backtests&#39; result page so you know what the settings have been for the executed backtest.</li><li>[IMPROVEMENT] Minor improvements to the UI of the dashboard.</li><li>[FIX] Fixed a bug where generated CSV files in backtests were empty if the <code>export_json</code> option was disabled.</li></ul><h2 id="_0-36-0-18-may-2022" tabindex="-1">0.36.0 (18 May 2022) <a class="header-anchor" href="#_0-36-0-18-may-2022" aria-label="Permalink to &quot;0.36.0 (18 May 2022)&quot;">​</a></h2><ul><li>[NEW FEATURE] Added new optional parameters to research module&#39;s <a href="https://docs.jesse.trade/docs/research/backtest.html#backtest" target="_blank" rel="noreferrer">backtest()</a> function to handle quantstat reports, export hyperparameters, equity-curve chart values, CSV and JSON export, tradingview&#39;s pine-editor output and also made chart generation optional so your script can run faster if you don&#39;t need it.</li><li>[IMPROVEMENT] Updated the <a href="https://docs.jesse.trade/docs/strategies/api.html#log" target="_blank" rel="noreferrer">self.log()</a> method to NOT send notifications by default in live mode. If you want to, you should pass <code>send_notification=True</code> to the method.</li><li>[IMPROVEMENT] Improved handling of errors in the REST API for fetching candles in the live mode which was introduced in version <code>0.35.0</code>.</li><li>[IMPROVEMENT] Improved handling of the <code>entry_price</code> at FTX to be exactly what you see on their exchange dashboard.</li><li>[IMPROVEMENT] Improved a few error messages in the live mode to include useful information about the error for easier debugging in the future.</li><li>[IMPROVEMENT] Added handling of <code>TypeError: &#39;NoneType&#39; object is not subscriptable</code> errors caused by API keys being expired on Bybit.</li><li>[IMPROVEMENT] Improved handling of a few common errors in the live mode that are safe to ignore.</li><li>[IMPROVEMENT] Improved error handling for Bybit drivers in import-candles mode.</li><li>[IMPROVEMENT] Refactored the notifications handler to work in a separate thread so that in the case of notifications taking long to respond, the main execution won&#39;t be affected.</li><li>[IMPROVEMENT] You will now be asked if you&#39;re sure about closing the dashboard. This is to prevent accidental closing of the dashboard tab.</li><li>[FIX] Fixed a couple of errors happening with notification drivers (Telegram and Discord)</li><li>[FIX] Fixed a bug where empty log files were created in <code>storage/logs/backtest-mode</code> when running the optimize mode.</li><li>[FIX] Fixed the <code>ValueError: No value exists in Redis for process ID of: xxx</code> error that occurred in docker setups. It requires you to update your project&#39;s <code>docker-compose.yml</code> manually. Here&#39;s a <a href="https://github.com/jesse-ai/jesse/issues/336#issuecomment-1121903402" target="_blank" rel="noreferrer">quick guide</a>.</li><li>[FIX] Implemented a workaround for an issue when sometimes multiple partially-filled orders in live mode caused unexpected behavior.</li><li>[FIX] Fixed an issue when paper mode raised an error about API keys of <code>Bybit Perpetuals</code> if their values were empty in the <code>.env</code> file.</li></ul><h2 id="_0-35-0-6-april-2022" tabindex="-1">0.35.0 (6 April 2022) <a class="header-anchor" href="#_0-35-0-6-april-2022" aria-label="Permalink to &quot;0.35.0 (6 April 2022)&quot;">​</a></h2><ul><li>[NEW FEATURE] Added the <a href="https://docs.jesse.trade/docs/research/candles.html#import-candles" target="_blank" rel="noreferrer">import_candles()</a> method to the &quot;research&quot; module.</li><li>[IMPROVEMENT] Live mode now uses the REST API of the exchange to fetch candles and update the most recent candles. This is on top of the current Websocket implementation for real-time updates; and is supposed to make Jesse&#39;s data storage more reliable.</li><li>[IMPROVEMENT] Added error handling for Telegram and Discord notifications.</li><li>[FIX] Fixed the <code>TypeError: decoding to str: need a bytes-like object, int found</code> occurring when resuming the previous live session with open orders on <code>Binance Futures</code> and <code>FTX Futures</code>.</li><li>[FIX] Fixed a visual bug where the entry price of the positions were displayed incorrectly on the dashboard when live trading.</li><li>[FIX] Fixed an overflow bug in the daily_balances when using the research module&#39;s <code>backtest()</code> function. This did not affect the existing backtest and optimize mode of the GUI dashboard.</li><li>[FIX] Fixed the bug where the progressbar was not working when importing candles in some browsers.</li></ul><h2 id="_0-34-0-24-march-2022" tabindex="-1">0.34.0 (24 March 2022) <a class="header-anchor" href="#_0-34-0-24-march-2022" aria-label="Permalink to &quot;0.34.0 (24 March 2022)&quot;">​</a></h2><ul><li>[IMPROVEMENTS] Instead of calculating changes in positions and orders, Jesse now uses data on the exchange to stay <strong>in sync in real-time</strong>.</li><li>[NEW FEATURE] Added <strong>persistency</strong> support to the live mode. Jesse is now able to stop and start at a later time without starting from scratch.</li><li>[NEW FEATURE] Added <code>is_stop_loss</code> and <code>is_take_profit</code> properties to the Order class. Useful for detecting the role of the executed order in methods such as <a href="https://docs.jesse.trade/docs/strategies/events.html#on-close-position-self-order" target="_blank" rel="noreferrer">on_close_position()</a>.</li><li>[BREAKING CHANGE] <strong>Dependencies are now locked</strong>. So from this version forward, doing <code>pip install jesse</code> will force your dependencies to be the same as the current version&#39;s requirements. This is to prevent you from installing a different version of the dependencies leading to unexpected behavior.</li><li>[NEW FEATURE] The position table now displays the liquidation price of the position in the live trading dashboard.</li><li>[NEW FEATURE] Added <code>has_long_entry_orders</code> and <code>has_short_entry_orders</code> properties to the Strategy class. They are used for knowing the type of entry orders for times that position is not opened yet such as inside the <code>should_cancel()</code> and <code>before()</code> methods and also in filters.</li><li>[NEW FEATURE] Implemented a &quot;check for newer version&quot; component in the GUI dashboard. So you&#39;ll be notified inside the app for newer versions of both the framework and the live plugin. You can skip updates if you choose to.</li><li>[IMPROVEMENTS] Improved the handling of &quot;PARTIALLY FILLED&quot; orders in the live mode. The new refactor handles them properly, and also you can see in the dashboard the amount of the order that was filled.</li></ul><h2 id="_0-33-0-15-february-2022" tabindex="-1">0.33.0 (15 February 2022) <a class="header-anchor" href="#_0-33-0-15-february-2022" aria-label="Permalink to &quot;0.33.0 (15 February 2022)&quot;">​</a></h2><ul><li>[NEW FEATURE] Added <a href="https://docs.jesse.trade/docs/research/backtest.html" target="_blank" rel="noreferrer">backtest</a> function to the <strong>&quot;research&quot;</strong> module allowing you to run backtests via your <strong>Python script</strong> or <strong>Jupyter notebook</strong>.</li><li>[NEW FEATURE] Added <a href="https://docs.jesse.trade/docs/research/candles.html#store-candles" target="_blank" rel="noreferrer">store_candles</a> function to the <code>research</code> module allowing you to store candles in the database. An example use case is to import candles from a <strong>CSV file</strong> so you can use them in your backtests.</li><li>[NEW FEATURE] Added <a href="https://docs.jesse.trade/docs/research/candles.html#fake-candle" target="_blank" rel="noreferrer">fake_candle</a>, <a href="https://docs.jesse.trade/docs/research/candles.html#fake-range-candles" target="_blank" rel="noreferrer">fake_range_candles</a> and <a href="https://docs.jesse.trade/docs/research/candles.html#candles-from-close-prices" target="_blank" rel="noreferrer">candles_from_close_prices</a> functions to the <code>research</code> module for generating fake candle data for backtest or other any kind of research.</li><li>[NEW FEATURE] Added the &quot;More&quot; button for orders in the live mode which opens a slide over the page where you can <strong>see all orders</strong>.</li><li>[NEW FEATURE] Added the <strong>value</strong> of the position (in USDT) to the live dashboard. To use it, hover on the <code>qty</code> of each position.</li><li>[NEW FEATURE] Added support for running <strong>multiple instances</strong> of Jesse <strong>simultaneously</strong>. Useful for those who want to trade using multiple sub-accounts. Just make sure they have different <code>APP_PORT</code> values in their <code>.env</code> file.</li><li>[New FEATURE] Added a new <strong>&quot;Report&quot;</strong> button that is available during live sessions for submitting a report alongside logs of your running session. The previous report button was only available if an exception was raised causing the session to stop. This one is <strong>always available</strong>.</li><li>[IMPROVEMENT] Exception <strong>tracebacks</strong> are now logged in the info logs and included in the reports helping us to track down bugs.</li><li>[IMPROVEMENT] Strategies can now be <strong>long-only</strong>. That means <code>should_short()</code> and <code>go_short()</code> are optional. If you don&#39;t implement them, the strategy will be long-only.</li><li>[IMPROVEMENT] Improved <strong>debugging mode</strong> in the optimize mode to include a log file that is downloadable at any point in time in the optimization mode.</li><li>[FIX] Fixed a bug causing optimization sessions to fail. The bug was introduced in the previous release.</li><li>[FIX] Fixed a bug where the optimize mode failed if the number of hyperparameters was 1.</li><li>[FIX] Fixed usage of extra-routes in optimize mode.</li><li>[FIX] You can now trade symbols that are longer than 9 characters such as <code>MATIC-USDT</code>.</li><li>[FIX] Fixed a bug where position validation was stuck in a loop in live mode when trading multiple routes.</li><li>[FIX] <code>watch_list</code> can now include all types of data. So errors such as <code>TypeError: Object of type Position is not JSON serializable</code> are no longer thrown.</li><li>[FIX] Fixed the <code>TypeError: Argument &#39;data&#39; has incorrect type (expected list, got dict)</code> error for the <code>Bybit Perpetual</code> driver.</li><li>[FIX] Improved the way we keep the WS alive for the ByBit driver. No more WS disconnects every 10 minutes (although the reconnecting was working just fine)</li><li>[FIX] Fixed the <code>AttributeError: &#39;NoneType&#39; object has no attribute &#39;watch_list&#39;</code> error for the live plugin.</li></ul><h2 id="_0-32-0" tabindex="-1">0.32.0 <a class="header-anchor" href="#_0-32-0" aria-label="Permalink to &quot;0.32.0&quot;">​</a></h2><ul><li>[NEW FEATURE]: Added the <strong><a href="https://docs.jesse.trade/docs/strategies/api.html#watch-list" target="_blank" rel="noreferrer">watch_list</a></strong> function for monitoring custom info in live modes.</li><li>[NEW FEATURE]: A &quot;<strong>Hyperparameters</strong>&quot; section is displayed in backtest results if the strategy has any hyperparameters defined.</li><li>[NEW FEATURE] Added <strong>Bybit Perpetual</strong> driver for live trading.</li><li>[NEW FEATURE]: Added support for PostgreSQL ssl mode via <code>POSTGRES_SSLMODE</code> environment variable. PR <a href="https://github.com/jesse-ai/jesse/pull/307" target="_blank" rel="noreferrer">submitted</a> by <a href="https://github.com/botzill" target="_blank" rel="noreferrer">Chirica Gheorghe</a>. Thanks Chirica!</li><li>[IMPROVEMENT] Sends notification for the &quot;reconnect&quot; message of the WS connection in live mode</li><li>[IMPROVEMENT] Strategy execution for <code>update_position</code> is paused for 3 seconds if an order execution event was received before <code>update_position</code> was called. Reduces the number of unexpected behavior in live mode.</li><li>[IMPROVEMENT] Doesn&#39;t log fee-charging if fees are set to zero. Makes it easier to read the logs when developing.</li><li>[FIX] Fixed an issue in multi-threading which led to <strong>memory leaks</strong> when live trading on Linux machines.</li><li>[FIX] Fixed a rare <code>KeyError</code> when generating charts after backtests.</li><li>[FIX] Fixed handling of the market <code>Partially filled</code> orders in live mode for <code>Binance Futures</code> driver. (limit <code>Partially filled</code> orders were working fine)</li><li>[FIX] Improved request submission in live mode to prevent <code>Connection reset by peer</code> error.</li><li>[FIX] Fixed a bug in updates of exit-orders made using <code>update_position()</code>.</li><li>[FIX] Fixed a bug in displaying the timeframe of candles in the live dashboard for timeframes bigger than <code>1m</code></li></ul><h2 id="_0-31-0" tabindex="-1">0.31.0 <a class="header-anchor" href="#_0-31-0" aria-label="Permalink to &quot;0.31.0&quot;">​</a></h2><ul><li>[NEW FEATURE] <code>Testnet Bybit Perpetuals</code> is now supported for backtesting, paper, and live trading</li><li>[NEW FEATURE] Added <a href="/docs/strategies/api.html#all-positions">all_positions</a> and <a href="/docs/strategies/api.html#portfolio-value">portfolio_value</a> properties to the strategy API</li><li>[Improvement] Automated &quot;handling of take-profit and stop-loss that are priced the opposite of what they are supposed to&quot; in strategies by closing the position instead of raising an exception causing the session to terminate.</li><li>[Improvement] Added support for cancelling (remaining) entry orders in <code>update_position()</code></li><li>[Improvement] Error logs are now logged as info logs as well so info logs now include all the logs.</li><li>[FIX] Fixed Discord notifications not working</li><li>[FIX] Fixed an error when handling rejected (take-profit/stop-loss) orders in live trading sessions</li><li>[FIX] Fixed a bug that happened when live trading strategies that require &quot;extra routes&quot;</li><li>[FIX] The research module has been updated to support usage in Jupyter Notebooks</li><li>[FIX] Fixed a bug in database migrations</li></ul><h2 id="_0-30-0-gui-dashboard" tabindex="-1">0.30.0 (GUI Dashboard) <a class="header-anchor" href="#_0-30-0-gui-dashboard" aria-label="Permalink to &quot;0.30.0 (GUI Dashboard)&quot;">​</a></h2><ul><li>[NEW FEATURE] GUI Dashboard is now available and replaces the CLI.</li><li>[NEW FEATURE] Docker setup is improved and is now a first-class citizen of Jesse and is shipped with all newly created Jesse projects. It enabled you to run Jesse with one single command!</li><li>[NEW FEATURE] Sending feedback and exception reports with optional log-file attachment right from within the dashboard.</li><li>[NEW FEATURE] Responsive design which makes it easy to use even on mobile devices (if you install Jesse on a remote server)</li><li>[NEW FEATURE] Added average execution time for optimizing mode</li><li>[NEW FEATURE] All main forms of the dashboard remember your inputs. So repeating backtests, etc is much easier with a click of a button</li><li>[NEW FEATURE] Ability to open multiple tabs (inside the dashboard itself) and run multiple candle importing and backtests in parallel.</li><li>[NEW FEATURE] You can choose between light and dark mode.</li><li>[BREAKING CHANGE] Environment variables are now set in the <code>.env</code> file, and application settings are now in the settings section of the dashboard. No more <code>config.py</code> and <code>live-config.py</code> files.</li><li>[BREAKING CHANGE] DNAs of the optimize mode are now defined in the strategy instead of the <code>routes.py</code> file</li><li>[Improvement] The error handling is now much more robust and reliable.</li><li>[Improvement] Every time you run an action like a backtest, the action is run in a separate process. This means that the action is not blocking the main process; hence, the main process can continue to run even if an error occurs. One example good that comes out of this is that notifications are now more reliable.</li><li>[Improvement] Installation of the live-trade plugin is now fully automated. No need to manually find your machine&#39;s info, download, and install.</li><li>[Improvement] Faster backtest execution with the debug mode enabled because of no actual terminal printing</li><li>[Improvement] Improved handling of database connections</li><li>And much more! This was the biggest release yet.</li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Starting from version 0.30.0, this page will include changelog of the live-trade plugin as well.</p></div><h2 id="_0-29-1" tabindex="-1">0.29.1 <a class="header-anchor" href="#_0-29-1" aria-label="Permalink to &quot;0.29.1&quot;">​</a></h2><p>[Improvement] Change Python version validation to recognize 3.10 (understood it as 3.1 before) [Improvement] The CSV created from the optimization mode now uses tab delimiter, as sometimes chars from the DNA would mess up the file. [Improvement] The CSV created from the optimization mode now includes all metrics from the backtest. [Improvement] Added missing REQUIRED_PACKAGES to setup.py [DEPRECATED] 3D and Week candles have been removed, as they differed from the exchange.</p><h2 id="_0-28-0" tabindex="-1">0.28.0 <a class="header-anchor" href="#_0-28-0" aria-label="Permalink to &quot;0.28.0&quot;">​</a></h2><ul><li>[BREAKING CHANGE] <code>on_take_profit()</code> and <code>on_stop_loss()</code> event methods have been removed, and replaced with the <code>on_closed_position()</code> method.</li><li>[Improvement] If the price difference between the current price and order price are significantly small (less than 0.01%) Jesse will use a MARKET order instead of LIMIT or STOP. This probably has no effect on your backtests but prevents some communication errors from exchange&#39;s side in live trading mode.</li><li>[Improvement] Replaced <code>crypto_empyrical</code> package with <code>quantstats</code>. This means now the metrics in Jesse&#39;s metrics report and Quantstat&#39;s HTML reports should be identical.</li><li>[NEW FEATURE] Added <code>smart sortino</code>, <code>smart sharpe</code> and <code>serenity</code> options for the optimize mode&#39;s fitness metric.</li></ul><h2 id="_0-27-3" tabindex="-1">0.27.3 <a class="header-anchor" href="#_0-27-3" aria-label="Permalink to &quot;0.27.3&quot;">​</a></h2><ul><li>[NEW FEATURE] Add support for <code>FTX Futures</code> exchange&#39;s perpetual futures trading (both live-trade and backtest).</li><li>[NEW FEATURE] Add initial support for <code>Bybit Perpetuals</code> driver (backtest only).</li><li>[NEW FEATURE] Added <code>wavelet_denoising()</code> utility function.</li><li>[Improvement] Can handle many of order rejection events that sometimes happen from exchange&#39;s side instead of requiring to restart your live session.</li></ul><h2 id="_0-26-0" tabindex="-1">0.26.0 <a class="header-anchor" href="#_0-26-0" aria-label="Permalink to &quot;0.26.0&quot;">​</a></h2><ul><li>[NEW FEATURE] Add <code>combinations_without_repeat</code> utility to create unique combinations. Useful for optimize mode.</li><li>[NEW FEATURE] New indicators: Arnaud Legoux Moving Average, Holt-Winter Moving Average, Natural Moving Average, Ehlers Distance Coefficient Filter, Moving Average Bands, Ulcer Index, Moving Average Adaptive Q, MWDX Average, Variable Length Moving Average, Square Root Weighted Moving Average, Squared Weighted Moving Average, Variable Power Weighted Moving Average, Cubed Weighted Moving Average, JSA Moving Average, End Point Moving Average, Ehlers Predictive Moving Average, Wavetrend, Hurst Exponent</li><li>[NEW FEATURE] - New Moving Averages added to the <code>ma</code> indicator.</li><li>[Improvement] Minor code optimizations.</li><li>[Improvement] Packages updated - Update websocket-client from 1.1.0 to 1.1.1, Update scipy from 1.7.0 to 1.7.1, Update pandas from 1.3.0 to 1.3.1, Update numpy from 1.20.3 to 1.21.1, Update pydash from 5.0.1 to 5.0.2, Update requests from 2.25.1 to 2.26.0, Update ta-lib from 0.4.20 to 0.4.21</li><li>[FIX] The <code>ma</code> indicator now better handles volume which is needed for <code>vwap</code> and <code>vwma</code>.</li><li>[FIX] The <code>kaufmanstop</code> now uses the correct formula for long and now supports the <code>matype</code> parameter.</li></ul><h2 id="_0-25-0" tabindex="-1">0.25.0 <a class="header-anchor" href="#_0-25-0" aria-label="Permalink to &quot;0.25.0&quot;">​</a></h2><ul><li>[NEW FEATURE] Introduces a plugin-based system for exchange drivers.</li><li>[BREAKING] Requires a <code>plugins.py</code> present in the project.</li><li>[CHANGE] Adjustments in the candle store as was required by the live trade mode.</li><li>Minor bug fixes</li></ul><h2 id="_0-24-0" tabindex="-1">0.24.0 <a class="header-anchor" href="#_0-24-0" aria-label="Permalink to &quot;0.24.0&quot;">​</a></h2><ul><li>[NEW FEATURE] Added new utility functions that are used in statistical analysis of the prices such as for writing statistical arbitrage strategies: z_score, are_cointegrated, prices_to_returns</li><li>[IMPROVEMENT] Refactored how we execute routes in the live trade mode so the order of execution is the same as defined in the <code>routes.py</code> file. This makes it possible to write strategies that depend on it such as statistical arbitrage.</li><li>[IMPROVEMENT] Added support for M1 macs.</li><li>[CHANGE] The <code>numba</code> package has become an optional package which was a requirement for supporting M1 macs. Now <code>numba</code> won&#39;t be installed by default. This means, if you are an M1 user, you don’t have to install <code>numba </code> and you can install Jesse as before and it will work just fine. If you are NOT an M1 user, then you can still take advantage of <code>numba</code> by installing it through running <code>pip install numba</code>.</li><li>[IMPROVEMENT] Minor bug fixes</li></ul><h2 id="_0-23-0" tabindex="-1">0.23.0 <a class="header-anchor" href="#_0-23-0" aria-label="Permalink to &quot;0.23.0&quot;">​</a></h2><ul><li>[NEW FEATURE] Added <code>self.log</code> method for easier logging from withing the strategy file.</li><li>[NEW FEATURE] Added new properties to the Strategy API: <code>liquidation_price</code>, <code>mark_price</code>, <code>funding_rate</code>, <code>next_funding_timestamp</code></li><li>[NEW FEATURE] Implemented the liquidation mechanism for the <code>isolated</code> mode in backtests, and both <code>isolated</code> and <code>cross</code> in live mode.</li><li>[NEW FEATURE] New indicators: Jurik Moving Average, Chande Kroll Stop, Choppiness Index, Pascals Weighted Moving Average, Symmetric Weighted Moving Average, Bandpass filter, Inverse Fisher Transform applied on RSI, KDJ</li><li>[NEW FEATURE] <code>devstop</code>, <code>rvi</code>, and <code>zscore</code> indicators now let you choose the <code>devtype</code>.</li><li>[Improvement] Packages updated - Update matplotlib from 3.4.1 to 3.4.2, Update numpy from 1.20.2 to 1.20.3, Update ta-lib from 0.4.19 to 0.4.20, Update websocket-client from 0.59.0 to 1.0.1, Update click from 7.1.2 to 8.0.1</li><li>[Improvement] Available <code>matypes</code> used in some indicators extended.</li><li>[Improvement] Improved handling of none string values in the logger</li></ul><h2 id="_0-22-0" tabindex="-1">0.22.0 <a class="header-anchor" href="#_0-22-0" aria-label="Permalink to &quot;0.22.0&quot;">​</a></h2><ul><li>[BREAKING CHANGE] For consistency <code>ta.vwmacd</code> now accepts <code>signal_period</code> instead of <code>signalperiod</code></li><li>[Improvement] Updated Docker images. By <a href="https://github.com/TheCrazyLex" target="_blank" rel="noreferrer">TheCrazyLex</a>.</li><li>[Improvement] Packages updated - scipy from <code>1.6.2</code> to <code>1.6.3</code>, arrow from <code>1.0.3</code> to <code>1.1.0</code>, quantstats from <code>0.0.30</code> to <code>0.0.32</code>, websocket-client from <code>0.58.0</code> to <code>0.59.0</code>, quantstats from <code>0.0.32</code> to <code>0.0.34</code>, pytest from <code>6.2.3</code> to <code>6.2.4</code></li><li>[Improvement] Rounding for live or paper now uses the required precision from the exchange. Could have caused exceptions before for coins with exotic precision requirement.</li><li>[Improvement] <code>risk_to_qty</code> and <code>size_to_qty</code> now round the qty down. As in some conditions the qty would otherwise exceed the <code>self.available_margin</code> / <code>self.capital</code> leading to the InsufficientMargin exception.</li><li>[Improvement] <code>risk_to_qty</code> now also accepts <code>precision</code> parameter.</li><li>[Improvement] The full report (quantstats) now uses 365 trading days for the metrics which makes its calculations crypto friendly. By <a href="https://github.com/sbkhosh" target="_blank" rel="noreferrer">sbkhosh</a> and <a href="https://github.com/mblum" target="_blank" rel="noreferrer">mblum</a>.</li><li>[Improvement] The ExampleStrategy imports ta and utils by default now.</li><li>[FIX] Error in <code>ta.minmax</code> solved. Namedtuple changed: <code>min -&gt; is_min </code> and <code>max -&gt; is_max</code></li><li>[FIX] Setting configs via environment variables now also works when spaces are involved. By <a href="https://github.com/julesGoullee" target="_blank" rel="noreferrer">julesGoullee</a>.</li><li>[NEW FEATURE] New indicator: Polarized Fractal Efficiency (PFE)</li></ul><h2 id="_0-21-3" tabindex="-1">0.21.3 <a class="header-anchor" href="#_0-21-3" aria-label="Permalink to &quot;0.21.3&quot;">​</a></h2><ul><li>[NEW FEATURE] Added HTML reports with a more complete set of metrics and charts enabled by the <code>--full-reports</code> flag in your backtests. By <a href="https://github.com/nicolay-zlobin" target="_blank" rel="noreferrer">nicolay-zlobin</a>.</li><li>[NEW FEATURE] New indicators: Elder Ray Index (ERI), ttm_trend, kurtosis, mean_ad, median_ad, skewness</li><li>[Improvement] Added a check for the right symbol format (with dash) for the import candle mode - preventing possible confusion and resulting errors.</li><li>[Improvement] A @cached property has been added to improve performance and avoid unnecessary repeated calculations. It&#39;s applied where sensible in the Strategy class and available via import to be used on indicators inside a users Strategy as well. Some strategies might see a huge boost because of this.</li><li>[Improvement] All indicators now use the helper functions same_length and slice_candles.</li><li>[Improvement] <code>self.metrics</code> is now only calculated if a trade happened leading to a performance boost.</li><li>[Improvement] The old way of working with strings in python (format) has been replaced with much faster f-strings leading to a performance boost.</li><li>[FIX] Incorrect InsufficientMargin exceptions that were caused by reduce_only orders.</li><li>[FIX] An error with the json export of the backtest that occurred is now fixed.</li><li>[FIX] Using futures mode you had to add all the used assets to the config.py file - although that should have only been needed for spot mode. This is not necessary anymore. Additionally the spot mode now gives clearer error if assets are missing in the config.</li><li>Multiple preparations for the live trade plugin. Other modes are unaffected by them.</li></ul><h2 id="_0-20-0" tabindex="-1">0.20.0 <a class="header-anchor" href="#_0-20-0" aria-label="Permalink to &quot;0.20.0&quot;">​</a></h2><ul><li>New indicators: Fibonacci&#39;s Weighted Moving Average (FWMA), Sine Weighted Moving Average (SINWMA), Chande Forcast Oscillator (CFO), Kaufman Efficency indicator, High Pass Filter 2-Pole, Supersmoother 3-Pole, Kaufmanstop, Safezonestop, Devstop, RSMK, STC, RVI, VWAP,</li><li>New timeframes: <code>45m</code>, <code>12h</code>, <code>3D</code>, <code>1W</code></li><li>[Improvement] The indicators now use the configured warmup_candles</li><li>[FIX] Spot should work no again thanks to a fix by <a href="https://github.com/discohead" target="_blank" rel="noreferrer">discohead</a></li><li>[FIX] Sometimes users faced a InsufficentMargin error - this was caused by a small bug in the handling leverage of market orders.</li><li>[Improvement] Durations are now displayed without decimals. By <a href="https://github.com/maebert" target="_blank" rel="noreferrer">maebert</a></li><li>[Improvement] The crossed utility should be a little faster now, as we only use numpy there now.</li></ul><h2 id="_0-19-2" tabindex="-1">0.19.2 <a class="header-anchor" href="#_0-19-2" aria-label="Permalink to &quot;0.19.2&quot;">​</a></h2><ul><li>Added <code>metrics</code> property to the Strategy API.</li><li>Added <code>available_margin</code> property to the Strategy API.</li><li>Added <code>leverage</code> property to the Strategy API.</li><li>Updated the behavior of <code>capital</code>. It now returns wallet balance.</li><li>Added support for leverage (except for a liquidation mechanism)</li><li>[BREAKING CHANGE] Change config values to work with the leverage support. Now instead of <code>margin</code> you need to enter <code>futures</code>.</li><li>Added <code>total_cost</code> to Position model.</li><li>Added <code>roi</code> (return on investment) property to the Position model. It is calculated while considering the leverage, the same way it is done on Binance Futures.</li><li>Added <code>RSX</code> indicator.</li><li>Added Market Change metric.</li><li>Added <code>signal_line()</code>, <code>streaks()</code>, <code>kelly_criterion()</code>, <code>strictly_increasing()</code>, <code>strictly_decreasing()</code>, and <code>dd()</code> utility functions.</li><li>Added <code>trades</code> property to the Strategy API for getting previous executed trades by <a href="https://github.com/nicolay-zlobin" target="_blank" rel="noreferrer">nicolay-zlobin</a>.</li><li>Updated the docker image. Updated the docs to work with docker-compose. By <a href="https://github.com/julesGoullee" target="_blank" rel="noreferrer">julesGoullee</a>.</li><li>Exported trades as json now include <code>considering_timeframes</code> by <a href="https://github.com/julesGoullee" target="_blank" rel="noreferrer">julesGoullee</a>.</li><li>Added <code>--skip_confirmation</code> flag to <code>import-canldes</code> command to avoid confirmation on candle duplicates by <a href="https://github.com/Gabri" target="_blank" rel="noreferrer">Gabri</a>.</li></ul><h2 id="_0-18-0" tabindex="-1">0.18.0 <a class="header-anchor" href="#_0-18-0" aria-label="Permalink to &quot;0.18.0&quot;">​</a></h2><ul><li>[BREAKING CHANGE] Dropped support for Python <code>3.6</code></li><li>[BREAKING CHANGE] Changed the syntax for symbols to use a <code>-</code> in the middle to separate the base and quote assets. Instead of <code>BTCUSD</code> you now need to enter <code>BTC-USD</code>.</li><li>Added elitism to genetic/evolution algorithm by <a href="https://github.com/fjelic" target="_blank" rel="noreferrer">fjelic</a></li></ul><h2 id="_0-17-0" tabindex="-1">0.17.0 <a class="header-anchor" href="#_0-17-0" aria-label="Permalink to &quot;0.17.0&quot;">​</a></h2><ul><li>[BREAKING CHANGE] Pass the <code>order</code> object as a parameter for event methods such as <code>on_open_position</code>, <code>on_take_profit</code>, <code>on_stop_loss</code>, <code>on_reduced_position</code>, and <code>on_increased_position</code> methods.</li><li>Fixed a bug for adding to open positions using <code>self.buy</code> and <code>self.sell</code>.</li><li>Added <code>increased_count</code> and <code>reduced_count</code> properties to the Strategy API.</li><li>[BREAKING CHANGE] Removed <code>is_reduced</code> and <code>is_increased</code> properties.</li><li>Added the <code>after()</code> method the to Strategy API</li><li>[BREAKING CHANGE] Renamed <code>prepare()</code> method to <code>before()</code></li></ul><h2 id="_0-16-0" tabindex="-1">0.16.0 <a class="header-anchor" href="#_0-16-0" aria-label="Permalink to &quot;0.16.0&quot;">​</a></h2><ul><li>Added a route validation</li><li>Improved performance of loading candles for cases with multiple routes</li><li>Added <code>routes</code> property to the Strategy API</li><li>Improvements in exception messages</li><li>Added <code>has_active_entry_orders</code> property to the Strategy API</li><li>Improved plotting of orders on the generated charts for backtest by (macd2)[<a href="https://github.com/macd2" target="_blank" rel="noreferrer">https://github.com/macd2</a>]</li><li>Fixed handling open trade at the end of backtest</li></ul><h2 id="_0-15-1" tabindex="-1">0.15.1 <a class="header-anchor" href="#_0-15-1" aria-label="Permalink to &quot;0.15.1&quot;">​</a></h2><ul><li>Added support for Python 3.9</li><li>Fixed calculations of formulas depending on Quantopian&#39;s empyrical package (like annual return, Sharpe Ratio, etc) using <a href="https://github.com/jesse-ai/crypto-empyrical" target="_blank" rel="noreferrer">our own fork</a> of it.</li><li>Changed default value of <code>type</code> for all exchanges in <code>config.py</code> to <code>margin</code></li><li>Added damiani_volatmeter indicator</li></ul><h2 id="_0-14-1" tabindex="-1">0.14.1 <a class="header-anchor" href="#_0-14-1" aria-label="Permalink to &quot;0.14.1&quot;">​</a></h2><ul><li>Changed the color of printed logs in <code>--debug</code> mode to white for more readability</li><li>Fixed a bug where <code>should_cancel()</code> was being executed in strategies with multiple entry orders</li><li>Made caching configurable. You can now change the settings for your cache driver or completely disable it</li><li>Added <code>sum_floats()</code> and <code>subtract_floats()</code> utility functions</li><li>Fixed a bug where position stayed open with a close-to-zero size caused by rounding issues in Python</li><li>Fixed for a bug in detecting executed orders with candles with gap</li><li>Added support for reduce-only orders (take-profit and stop-loss orders)</li><li>Added VossFilter indicator</li><li>Added TrendFlex indicator</li><li>Added ReFlex indicator</li><li>Added High Pass Filter indicator</li><li>Added Roofing indicator</li><li>Added DV indicator</li></ul><h2 id="_0-13-1" tabindex="-1">0.13.1 <a class="header-anchor" href="#_0-13-1" aria-label="Permalink to &quot;0.13.1&quot;">​</a></h2><ul><li>Added support for balance handling for trading on spot markets</li><li>Improved calculation and logging of fees (when <code>--debug</code> flag is enabled)</li><li>Improved calculation of daily balance change. It is now more accurate.</li><li>Improved format in displaying of currencies. Instead of <code>10000</code>, it now displays <code>10,000</code>.</li></ul><h2 id="_0-12-7" tabindex="-1">0.12.7 <a class="header-anchor" href="#_0-12-7" aria-label="Permalink to &quot;0.12.7&quot;">​</a></h2><ul><li>Made number of warmup candles configurable</li><li>Fixed an issue with log folder being absent in newly created projects by <a href="https://github.com/jparklev" target="_blank" rel="noreferrer">jparklev</a></li><li>Improved performance of the chande indicator</li></ul><h2 id="_0-12-2" tabindex="-1">0.12.2 <a class="header-anchor" href="#_0-12-2" aria-label="Permalink to &quot;0.12.2&quot;">​</a></h2><ul><li>Added the <code>--cpu</code> option for the optimize mode to specify the number of cpu cores to use when running the optimize mode.</li><li>Improved monitoring dashboard of the optimization mode.</li></ul><h2 id="_0-12-1" tabindex="-1">0.12.1 <a class="header-anchor" href="#_0-12-1" aria-label="Permalink to &quot;0.12.1&quot;">​</a></h2><ul><li>Renamed <code>hyper_parameters()</code> method to <code>hyperparameters()</code></li><li>Fixed <code>--dna</code> flag in &quot;jesse routes&quot; command</li><li>Improved error detection in the optimize mode</li><li>Fixed when few of DNA trials caused optimize session to fail entirely</li><li>Optimize mode&#39;s traceback is now printed to a log file</li><li>Improved optimize mode&#39;s monitoring dashboard</li><li>Fixed an issue with newly created projects missing the log directory</li><li>Added <code>.csv</code> and <code>.json</code> files to gitignore of newly created projects</li></ul><h2 id="_0-11-0" tabindex="-1">0.11.0 <a class="header-anchor" href="#_0-11-0" aria-label="Permalink to &quot;0.11.0&quot;">​</a></h2><ul><li>Implemented the initial version of the optimize mode which uses the Genetic Algorithm to find the best parameters for your strategy.</li></ul><h2 id="_0-10-0" tabindex="-1">0.10.0 <a class="header-anchor" href="#_0-10-0" aria-label="Permalink to &quot;0.10.0&quot;">​</a></h2><ul><li>Suppression of the &quot;FutureWarning: pandas.util.testing is deprecated&quot; caused by empyrical</li><li>Added KST indicator</li><li>Added Coppock curve indicator</li><li>Added vortex indicator</li><li>Added EFI indicator</li><li>Added Chandelier Exit indicator</li><li>Update of scipy and matplotlib</li><li>Fixed issue related to NegativeBalance</li><li>Some fixes and additions related to pytest</li></ul><h2 id="_0-9-0" tabindex="-1">0.9.0 <a class="header-anchor" href="#_0-9-0" aria-label="Permalink to &quot;0.9.0&quot;">​</a></h2><ul><li>Refactored directories that generated output files are stored at (csv, json, tradingview, charts).</li><li><code>json</code> logs files are disabled by default. You now HAVE TO use the <code>json</code> flag to enable it.</li><li>Added CSV output for completed trades by <a href="https://github.com/h0ke" target="_blank" rel="noreferrer">h0ke</a>.</li></ul><h2 id="_0-8-2" tabindex="-1">0.8.2 <a class="header-anchor" href="#_0-8-2" aria-label="Permalink to &quot;0.8.2&quot;">​</a></h2><ul><li>Added exception for when trying to spend more than available exchange balance by <a href="https://github.com/fengkiej" target="_blank" rel="noreferrer">fengkiej</a></li><li>Added <a href="/docs/strategies/api.html#fee-rate">fee_rate</a> property to Strategy API</li><li>Added <code>fee_rate</code> as optional parameter for <a href="/docs/utils.html#risk-to-qty">risk_to_qty</a> and <a href="/docs/utils.html#size-to-qty">size_to_qty</a> utilities</li><li>Added readable error for when strategy structure is incorrect</li><li><a href="https://docs.jesse.trade/docs/utils.html#numpy-candles-to-dataframe" target="_blank" rel="noreferrer">numpy_candles_to_dataframe</a> now uses Pandas datetime format for candle timestamps by <a href="https://github.com/lightyear15" target="_blank" rel="noreferrer">lightyear15</a></li><li>Improved exception text for unsupported exchanges</li></ul><h2 id="_0-7-1" tabindex="-1">0.7.1 <a class="header-anchor" href="#_0-7-1" aria-label="Permalink to &quot;0.7.1&quot;">​</a></h2><ul><li>Added the __init__ method to the strategy API</li><li>Added the terminate() method to the strategy API</li><li>Added validation for <code>qty==0</code></li><li>Added additional parameters to srsi indicator by <a href="https://github.com/Gabri" target="_blank" rel="noreferrer">Gabri</a></li></ul><h2 id="_0-6-3" tabindex="-1">0.6.3 <a class="header-anchor" href="#_0-6-3" aria-label="Permalink to &quot;0.6.3&quot;">​</a></h2><ul><li>Fix issue <a href="https://github.com/jesse-ai/jesse/issues/34" target="_blank" rel="noreferrer">#34</a></li><li>Made filter misusage exception more readable</li><li>Added new ratios in metrics: Calmar, Sortino, Omega</li><li>Improve TradingView output by <a href="https://github.com/Gabri" target="_blank" rel="noreferrer">Gabri</a></li><li>Added supersmoother indicator</li><li>Added gauss indicator</li><li>Added itrend indicator</li><li>Added faulty indicator</li><li>Added beta indicator</li><li>Added LINEARREG_ANGLE - Linear Regression Angle indicator</li><li>Added LINEARREG - Linear Regression indicator</li><li>Added AVGPRICE - Average Price indicator</li><li>Added VWMACD - Volume Weighted Moving Average Convergence/Divergence indicator</li><li>Added AD - Chaikin A/D Line indicator</li><li>Added keltner indicator by <a href="https://github.com/jeremytregunna" target="_blank" rel="noreferrer">jeremytregunna</a></li></ul><h2 id="_0-5-0" tabindex="-1">0.5.0 <a class="header-anchor" href="#_0-5-0" aria-label="Permalink to &quot;0.5.0&quot;">​</a></h2><ul><li>Fixed an <a href="https://forum.jesse.trade/d/37-strange-behavior-on-filters" target="_blank" rel="noreferrer">issue</a> with filters.</li><li>Fixed an <a href="https://github.com/jesse-ai/jesse/issues/19" target="_blank" rel="noreferrer">issue</a> with CWD</li><li>Added new indicators: Hull Moving Average, Zero-Lag Exponential Moving Average, Donchian Channels, Empirical Mode Decomposition, RSI Laguerre Filter, True strength index (TSI), Fractal Adaptive Moving Average (FRAMA), Awesome Oscillator, Alligator, SMMA (Smoothed Moving Average)</li></ul><h2 id="_0-4-0" tabindex="-1">0.4.0 <a class="header-anchor" href="#_0-4-0" aria-label="Permalink to &quot;0.4.0&quot;">​</a></h2><ul><li>Added <a href="https://pypi.org/project/tulipy/" target="_blank" rel="noreferrer">Tulipy</a> library as a dependency.</li><li>Added <a href="./indicators/reference.html#vwma">vwma</a>, <a href="./indicators/reference.html#srsi">srsi</a>, and <a href="./indicators/reference.html#fisher">fisher</a> indicators.</li><li>Added support for <code>8h</code> timeframe.</li><li>Removed the wrong time estimation for import-candles mode. <a href="https://github.com/jesse-ai/jesse/pull/14/files" target="_blank" rel="noreferrer">PR</a> by <a href="https://github.com/0xVox" target="_blank" rel="noreferrer">0xVox</a>.</li></ul>',91),n=[a];function d(s,l,c,h,u,p){return o(),t("div",null,n)}const f=e(r,[["render",d]]);export{g as __pageData,f as default};
